import React from "react";
import Header from "../common/Header";

const HomePage = () => {
  return (
    <>
      <Header pageTitle={"Home Page"} />
      <div className="mx-0 mt-4 p-4 bg-gray-100 border-b border-gray-600 justify-between">
        <h2 className="text-xl font-bold mb-2">Announcement</h2>
        <p></p>
      </div>
      <div className="bg-gray-100 p-4 rounded-lg shadow-md">
      <div className="flex justify-between items-center pb-4 border-b border-gray-200">
        <h2 className="text-xl font-bold text-gray-800">Announcement Section</h2>
        <button className="btn-primary">ADD NEW ANNOUNCEMENT</button>
      </div>
      <div className="text-gray-700">
        <p>Notify all students of your announcement</p>
        <div className="mt-4">
          <div className="border rounded-lg p-4 mb-4">
            <h3 className="text-lg font-medium">Release of Grades</h3>
            <div className="flex justify-between items-center text-sm text-gray-500 mt-2">
              <span>Posted: January 1, 2024</span>
              <a href="#" className="text-blue-500 hover:underline">Details</a>
            </div>
          </div>
          {/* Add more announcement items here */}
        </div>
      </div>
    </div>
    </>
  );
};

export default HomePage;
